def EL2_6dof(theta,position,velocity,torque):
  q=position;dq =velocity;
  M=theta*M_6dof(q);
  C=theta*C_6dof(q,dq);
  G=theta*G_6dof(q);
  output_2 = np.dot(inv(M),(torque - np.dot(C,dq) -G));
  velocity =velocity.reshape(6,1)
  output = np.vstack((velocity,output_2))
  return(output)

